INSERT INTO mental
    (user_no, score, psychological_state, result_content, separation, update_date)
VALUES
    (1, 15, 'Normal', '현재 정신건강 상태가 양호합니다. 업무와 개인생활의 균형을 잘 유지하고 있으며, 스트레스 관리도 효과적으로 하고 있습니다. 지속적인 건강한 생활 패턴을 유지하시기 바랍니다.', 'STRESS', '2024-12-15'),
    (2, 28, 'Concern', '약간의 스트레스 징후가 보입니다. 업무 부담이나 대인관계에서 오는 긴장감이 있을 수 있습니다. 충분한 휴식과 취미활동을 통해 스트레스를 해소하시고, 필요시 전문가 상담을 고려해보세요.', 'STRESS', '2024-12-14'),
    (3, 12, 'Normal', '정신적으로 건강한 상태를 유지하고 있습니다. 긍정적인 사고와 활발한 사회활동이 도움이 되고 있습니다. 현재의 라이프스타일을 지속하며 정기적인 자기점검을 해보시기 바랍니다.', 'BURNOUT', '2024-12-13'),
    (4, 35, 'Mild', '경미한 수준의 심리적 부담을 경험하고 있습니다. 업무 과부하나 개인적 고민이 영향을 주고 있을 수 있습니다. 규칙적인 운동과 명상, 그리고 신뢰할 수 있는 사람과의 대화를 통해 개선해보세요.', 'STRESS', '2024-12-12'),
    (5, 45, 'Severe', '상당한 수준의 번아웃 증상이 나타납니다. 업무에 대한 의욕 저하, 피로감, 무력감 등을 경험하고 있을 수 있습니다. 충분한 휴식과 업무 조정이 필요하며, 전문가의 도움을 받으시길 권합니다.', 'BURNOUT', '2024-12-11'),
    (6, 18, 'Normal', '전반적으로 안정된 정신건강 상태입니다. 자연과의 접촉과 명상 등의 활동이 긍정적인 영향을 주고 있습니다. 현재의 건강한 습관들을 지속하시면서 자기관리에 계속 신경 써주세요.', 'BURNOUT', '2024-12-10'),
    (7, 32, 'Mild', '경미한 스트레스 상태가 관찰됩니다. 새로운 환경이나 업무 변화에 적응하는 과정에서 오는 긴장감일 수 있습니다. 점진적인 적응과 함께 스트레스 완화 방법을 실천해보시기 바랍니다.', 'STRESS', '2024-12-09'),
    (8, 22, 'Concern', '가벼운 주의가 필요한 상태입니다. 독립적인 성향으로 인해 혼자서 문제를 해결하려 하다가 스트레스가 쌓일 수 있습니다. 적절한 사회적 지지와 도움을 받아들이는 것도 중요합니다.', 'STRESS', '2024-12-08'),
    (9, 45, 'Severe', '상당한 수준의 번아웃 증상이 나타납니다. 업무에 대한 의욕 저하, 피로감, 무력감 등을 경험하고 있을 수 있습니다. 충분한 휴식과 업무 조정이 필요하며, 전문가의 도움을 받으시길 권합니다.', 'BURNOUT', '2024-12-11'),
    (10, 18, 'Normal', '전반적으로 안정된 정신건강 상태입니다. 자연과의 접촉과 명상 등의 활동이 긍정적인 영향을 주고 있습니다. 현재의 건강한 습관들을 지속하시면서 자기관리에 계속 신경 써주세요.', 'BURNOUT', '2024-12-10'),
    (11, 32, 'Mild', '경미한 스트레스 상태가 관찰됩니다. 새로운 환경이나 업무 변화에 적응하는 과정에서 오는 긴장감일 수 있습니다. 점진적인 적응과 함께 스트레스 완화 방법을 실천해보시기 바랍니다.', 'STRESS', '2024-12-09'),
    (12, 22, 'Concern', '가벼운 주의가 필요한 상태입니다. 독립적인 성향으로 인해 혼자서 문제를 해결하려 하다가 스트레스가 쌓일 수 있습니다. 적절한 사회적 지지와 도움을 받아들이는 것도 중요합니다.', 'STRESS', '2024-12-08');
